import * as React from 'react';

import './Sobre.css'


export default function Sobre() {
  return (

    <div className='container-quemSomos'>
      <main className='container-main-quemSomos'>
        <h1>Sobre</h1>


        <p >A TopQueen nasceu com o propósito de produzir peças que unem Fitness e casual.
          Entregando modelos Fitwear com tecido confortável e de alta qualidade que proporciona
          uma experiência satisfatória e motivacional para cada estilo.
          Localizada em São Paulo, e com um modelo de negócios totalmente em e-commerce.
          Nossa missão como empresa é motivarmos mulheres tornando-as mais empoderadas com com conforto estilo
          Prezamos pelo respeito ao próximo e pela meritocracia para um atendimento personalzado e humanizado
          para auxiliar ossos clientes a terem uma experiência única conosco.
          Temos como objetivo tornar-se líder no segmento Fitwear, incentivar na qualidade de vida e aumentar a auto estima de tods as mulheres </p>

      </main>


    </div>



  );
}
